function Trasaction() {
  const date = new Date();
  const showTime = date.getHours() + ":" + date.getMinutes();
  return (
    <div>
      <span>{`${"Money transaferd to Faizan --> "}`}</span>
      <span>{`${showTime}`}</span>
      {/* <span>{`${currentTime}`}</span> */}
    </div>
  );
}
export default Trasaction;
